function Rect(n,color,targetColor){
    createjs.Shape.call(this);
    this.setRectType = function(type){
        this._rectType = type;
        switch (type){
            case 1:
                this.setColor(color);
                break;
            case 2:
                this.setColor(targetColor);
                break;
        }
    };
    this.getRectType = function () {
        return this._rectType;
    };
    this.setColor = function (colorStr) {
        this.graphics.beginFill(colorStr);
        this.graphics.drawRect(0,0,400/n-5,400/n-5);
        this.graphics.endFill(colorStr);
    };
    this.setRectType(1);
}
Rect.prototype = new createjs.Shape();

var app = {
    lvMap: [2, 3, 4, 5, 5, 6, 6, 7, 7, 7, 8, 8, 8, 8, 8, 8, 9],
    lvT: ["瞎子", "色盲", "色郎", "色狼", "色鬼", "色魔", "超級色魔", "变态色魔", "孤独求色"]
};
app.init = function () {
    this.score = 0;
    this.timeout = 60;
    this.lv=0;
    this.timer=null;
    this.dif=0;
    $('#score').html(0);
    $('#time').html(60);
    this.stage = new createjs.Stage('gameView');
    createjs.Ticker.setFPS(30);
    createjs.Ticker.addEventListener('tick',this.stage);
    this.gameView = new createjs.Container();
    this.stage.addChild(this.gameView);
    this.addRect();
    this.countdown();
    $('#index').addClass('off');
    $('#ing').removeClass('off');
};
app.addRect = function () {
    var self = this;

    var n = self.lvMap[self.lv++] || 9,
        rcl = self.randomColor(),
        cl = rcl.cl,
        targetCl = rcl.scl,
        targetX = Math.floor(Math.random() * n),
        targetY = Math.floor(Math.random() * n),
        r;
    //console.log(colors);
    for (var x = 0; x < n; ++x) {
        for (var y = 0; y < n; ++y) {
            r = new Rect(n,cl,targetCl);
            r.x = x * (400 / n);
            r.y = y * (400 / n);
            if(x == targetX && y == targetY){
                r.setRectType(2);
                r.addEventListener('click',function(){
                    $('#score').html(++self.score);
                    self.gameView.removeAllChildren();
                    self.addRect();
                })
            }
            self.gameView.addChild(r);
        }
    }
};
app.randomColor = function () {
    var dif = 15 * (Math.max(9 - this.lv, 1)),
        r = Math.floor(Math.random() * (255 - dif)),
        g = Math.floor(Math.random() * (255 - dif)),
        b = Math.floor(Math.random() * (255 - dif));
    return {
        cl: this.rgb(r, g, b),
        scl: this.rgb(r + dif, g + dif, b + dif)
    }
};
app.rgb = function (r,g,b) {
    return 'rgb(' + [r, g, b].join(',') + ')'
};
app.countdown = function(){
    $('#pause').addClass('off');
    $('#ing').removeClass('off');
    var self = this;
    self.timer = setInterval(function(){
        if(self.timeout){
            $('#time').html(--self.timeout)
        }else{
            self.gameover()
        }
    },1000);
};
app.pause = function(){
    clearInterval(this.timer);
    $('#ing').addClass('off');
    $('#pause').removeClass('off');
};
app.gameover = function(){
    clearInterval(this.timer);
    var score = this.score,
        result = this.lvT[score < 15 ? 0 : Math.ceil((score - 15) / 5)] || this.lvT[8];
    $('#ing').addClass('off');
    $('#result').html(result + 'lv' + score);
    $('#gameover').removeClass('off');
};
app.again = function () {
    clearInterval(this.timer);
    $('#gameover').addClass('off');
    this.init();
};
$(function(){
    $('#startBtn').click(function(){
        app.init();
    });
    $('#pauseBtn').on('click',function(){
        app.pause();
    });
    $('#continueBtn').on('click',function(){
        app.countdown();
    });
    $('#againBtn').on('click',function(){
        app.again();
    });
});
